(3743, 3749, 7487, 7488, '', 'http://www.atlanticcountyclerk.org/', '', 'Office Hours: Monday and Wednesday 8:30 AM - 6:00 PM;\r\nTuesday, Thursday, and Friday 8:30 AM - 4:00PM.  Voted Ballots are to be returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (609) 343-2240.  The County Clerk''s office is located at 5901 Main St,  Mays Landing, NJ 08330.', 1, '2009-11-16 13:12:41'),
(3744, 3750, 7489, 7490, '', 'http://www.co.bergen.nj.us/countyclerk/', '', 'The County Clerk issues the absentee ballots; they are returned to the Board of Elections. Should you need or wish to fax your voted ballot, the Board of Elections fax number is (201) 336-6242. The County Clerk''s office is located at One Bergen County Plaza, Room 130, Hackensack, NJ 07601-7074.\r\n\r\nOffice Hours: Monday-Friday 9-4:30pm. ', 1, '2009-11-16 13:12:41'),
(3745, 3751, 7491, 7492, '', 'http://www.co.burlington.nj.us/departments/countyclerk/index.htm', '', 'The County Clerk issues the absentee ballots; they are returned to the Board of Elections. NOTICE- use of Federal Post Card Application registers applicant to recceive absentee ballots through two federal elections.', 1, '2009-11-16 13:12:41'),
(3746, 3752, 7493, 7494, '', 'http://www.co.camden.nj.us/government/offices/clerk/index.html', '', 'The County Clerk issues the absentee ballots; they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (856) 661-3616.  The County Clerk''s office is located at the County Administration Building, 600 Market Street, Suite 316, Camden, NJ 08101-0300.  Ms. Lattanzi handles military voters only. Civilian voters should contact Anne-Marie Manko at the same phone and fax number. Ms. Manko''s email is ammanko@camdencounty.com.', 1, '2009-11-16 13:12:41'),
(3747, 3753, 7495, 7496, '', 'http://www.capemaycountygov.net/Cit-e-Access/webpage.cfm?TID=5&TPID=417', '', 'The County Clerk issues the absentee ballots; they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (609) 465-1639.  The County Clerk''s office is located at 7 North Main Street, Cape May Court House, NJ 08210-2117.', 1, '2009-11-16 13:12:41'),
(3748, 3754, 7497, 7498, '', 'http://www.co.cumberland.nj.us/govtserv/departments/elections/', '', 'The County Clerk issues the absentee ballots; they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (856) 451-3172. The County Clerk is located at 60 West Broad Street, Bridgeton, NJ 08302-2552.  ', 1, '2009-11-16 13:12:41'),
(3749, 3755, 7499, 7500, '', 'http://www.essexclerk.com/election_absentee.html', '', 'The County Clerk issues the absentee ballots; they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (973) 621-6480. The County Clerk''s office is 465 Dr. Martin Luther King Boulevard, Room 247, Newark, NJ 07102-1795.  Office Hours:  8:30 - 4, Monday through Friday.', 1, '2009-11-16 13:12:41'),
(3750, 3756, 7501, 7502, '', 'http://www.co.gloucester.nj.us/', '', 'The County Clerk issues the absentee ballots; they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (856) 251-1647.  The County Clerk''s Election Division office is located at 550 Grove Road in Paulsboro.  Kathy Seder also works with overseas and military voters and her email address is kseder@co.gloucester.nj.us.  Office Hours are Monday through Friday, 8:30 to 4.', 1, '2009-11-16 13:12:41'),
