(3752, 3758, 7505, 7506, '', 'http://www.co.hunterdon.nj.us', '', 'The County Clerk issues the absentee ballot; they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (908) 806-4686.  The County Clerk is located at 71 Main Street, Hall of Records, Flemington, NJ 08822-1412.', 1, '2009-11-16 13:12:41'),
