(3761, 3767, 7523, 7524, '', 'http://www.sussexcountyclerk.com/election.html', '', 'You can also call Deputy Clerk Brian McNeilly at 973-579-0900 ext. 1501.  The County Clerk''s office mails the absentee ballots, they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (973) 575-0955.  The County Clerk''s office is located at 83 Spring Street, Suite 304, Newton, NJ. Open Mon, 8:00-6:00, T-F, 8:00-4:00.', 1, '2009-11-16 13:12:41'),
(3762, 3768, 7525, 7526, '', 'http://www.unioncountynj.org/ctyclerk/absent04.html', '', 'The County Clerk issues the absentee ballots, they are returned to the Board of Elections.  Should you need or wish to fax your voted ballot, the Board of Elections fax number is (908) 527-4127.  The County Clerk''s office is the same as the mailing address.', 1, '2009-11-16 13:12:41'),
